@mikel basically when computing union(x,y) you are combining the trees x and y are in
so the first part of the union code is:
```x = find(x);
y = find(y);```
find is where path compression happens as described in the disjoint set page of the mp_mazes, it recursively pushes x and everything above x to be the child of the root node, and returns the root node. The value in the root nodes is either the rank or size, which is what is compared when combining. If no path compression happens the sets just combine based on the root node, also no nodes linking to the initial x and y are compressed.
